import React, { useState, useEffect } from 'react';
import Post from '../components/Post'; // Asumimos que crearemos este componente más tarde

function Feed() {
  // Ejemplo estático de datos de posts, eventualmente serán cargados de la API
  const [posts, setPosts] = useState([
    { id: 1, title: "Post 1", content: "Content of post 1", author: "Author 1", date: "2022-01-01" },
    { id: 2, title: "Post 2", content: "Content of post 2", author: "Author 2", date: "2022-02-01" }
  ]);

  return (
    <div>
      <h1>Feed</h1>
      {posts.map(post => (
        <Post key={post.id} title={post.title} content={post.content} author={post.author} date={post.date} />
      ))}
    </div>
  );
}

export default Feed;
